import React, { Component } from 'react';

import axios from 'axios'

class Product extends Component {
    constructor(props){
        super(props);

        this.state = {
            id: props.match.params.id
        };
    }

    componentDidMount(){
        axios.get(`https://api.mercadolibre.com/items/${this.state.id}`)
            .then((data) => {
                console.log(data)
            });
    }

    render(){
        return (
            <div>Product</div>
        );
    }
}

export default Product;
